import React from 'react';
import './ClubCard.css'; 
import { Card, CardBody, CardFooter, CardHead, CardHeader } from '@patternfly/react-core';
import club1 from './vsa.png'


export default class ClubCard extends React.Component {
    render() {
    return (
        <Card>
    <CardHead>
      <img src={club1} alt="PatternFly Logo" style={{ height: '50px' }}/>
    </CardHead> 
    <CardHeader>Header</CardHeader>
    <CardBody>Body</CardBody>
  </Card>
    );
}
}
